INSERT INTO `v1_2aa4231fe44914bf99436ab682720838113f3a43c0a5684aa4c5bd2e6a138ecf` VALUES (3000, 2, 1, "調子が上がって\nきたなっ", "vo_minigame_1013_icon_2_002_001", 2, "訓練はまだ\nここからですわ", "vo_minigame_1013_icon_1_002_001", 2, 1000);
INSERT INTO `v1_2aa4231fe44914bf99436ab682720838113f3a43c0a5684aa4c5bd2e6a138ecf` VALUES (3000, 2, 2, "ほらほら、\nまだいけるだろ？", "vo_minigame_1013_icon_2_003_001", 2, "クスクス、悪くない\n流れですわね", "vo_minigame_1013_icon_1_003_001", 2, 5000);
INSERT INTO `v1_2aa4231fe44914bf99436ab682720838113f3a43c0a5684aa4c5bd2e6a138ecf` VALUES (3000, 2, 3, "へへっ、おまえら\nやるじゃねえか！", "vo_minigame_1013_icon_2_004_001", 2, "すばらしい\n記録ですわ", "vo_minigame_1013_icon_1_004_001", 3, 10000);
INSERT INTO `v1_2aa4231fe44914bf99436ab682720838113f3a43c0a5684aa4c5bd2e6a138ecf` VALUES (3000, 2, 4, "あたしたちはまだ\n止まらねえぜ！", "vo_minigame_1013_icon_2_005_001", 3, "乗りに乗って\nいますわね", "vo_minigame_1013_icon_1_005_001", 3, 10000);
INSERT INTO `v1_2aa4231fe44914bf99436ab682720838113f3a43c0a5684aa4c5bd2e6a138ecf` VALUES (3000, 2, 5, "見てろよ！\nマコト班の快進撃だ！", "vo_minigame_1013_icon_2_005_002", 3, "まだまだ行きます\nついてきなさい", "vo_minigame_1013_icon_1_005_002", 3, 10000);
INSERT INTO `v1_2aa4231fe44914bf99436ab682720838113f3a43c0a5684aa4c5bd2e6a138ecf` VALUES (3000, 2, 6, "うおぉぉっ！\n絶好調だぜ！", "vo_minigame_1013_icon_2_005_003", 3, "エリコ班の\n本領発揮ですわ！", "vo_minigame_1013_icon_1_005_003", 3, 10000);
INSERT INTO `v1_2aa4231fe44914bf99436ab682720838113f3a43c0a5684aa4c5bd2e6a138ecf` VALUES (3000, 2, 7, "どこまで行けるか\n楽しみだなっ！", "vo_minigame_1013_icon_2_006_001", 4, "ここからは\n前人未到の領域です！", "vo_minigame_1013_icon_1_006_001", 3, 0);
INSERT INTO `v1_2aa4231fe44914bf99436ab682720838113f3a43c0a5684aa4c5bd2e6a138ecf` VALUES (1000, 3, 8, "まだ諦めんなよっ", "vo_minigame_1013_icon_2_007_001", 5, "厄介でしたわ…", "vo_minigame_1013_icon_1_007_001", 4, 1);
INSERT INTO `v1_2aa4231fe44914bf99436ab682720838113f3a43c0a5684aa4c5bd2e6a138ecf` VALUES (1000, 3, 9, "冷やっとしたぜ…！", "vo_minigame_1013_icon_2_007_002", 5, "油断大敵です", "vo_minigame_1013_icon_1_007_002", 4, 1);
INSERT INTO `v1_2aa4231fe44914bf99436ab682720838113f3a43c0a5684aa4c5bd2e6a138ecf` VALUES (1000, 3, 10, "弱音を吐くなっ", "vo_minigame_1013_icon_2_007_003", 5, "忌々しいっ…", "vo_minigame_1013_icon_1_007_003", 4, 1);
INSERT INTO `v1_2aa4231fe44914bf99436ab682720838113f3a43c0a5684aa4c5bd2e6a138ecf` VALUES (1500, 4, 11, "マコト班集合！", "vo_minigame_1013_icon_2_008_001", 6, "大所帯ですわね", "vo_minigame_1013_icon_1_008_001", 3, 99);
INSERT INTO `v1_2aa4231fe44914bf99436ab682720838113f3a43c0a5684aa4c5bd2e6a138ecf` VALUES (1500, 4, 12, "連携してくぞ！", "vo_minigame_1013_icon_2_008_002", 6, "エリコ班へようこそ", "vo_minigame_1013_icon_1_008_002", 3, 99);
INSERT INTO `v1_2aa4231fe44914bf99436ab682720838113f3a43c0a5684aa4c5bd2e6a138ecf` VALUES (3000, 1, 13, "みんなに力を！", "vo_minigame_1013_icon_2_020_001", 8, "ナナカちゃんに\nお任せあれ", "vo_minigame_1013_icon_1_020_001", 6, 0);
INSERT INTO `v1_2aa4231fe44914bf99436ab682720838113f3a43c0a5684aa4c5bd2e6a138ecf` VALUES (3000, 1, 14, "任せてくれたまえ", "vo_minigame_1013_icon_2_022_001", 9, "はっはっは！\n任せろ！", "vo_minigame_1013_icon_1_022_001", 7, 0);
INSERT INTO `v1_2aa4231fe44914bf99436ab682720838113f3a43c0a5684aa4c5bd2e6a138ecf` VALUES (3000, 1, 15, "ほな、いきまひょか", "vo_minigame_1013_icon_2_023_001", 10, "どんどんいくわよ", "vo_minigame_1013_icon_1_023_001", 8, 0);
